import com.productos.datos.Conexion;

/**
 * Servlet implementation class ProcesarFormularioServlet
 */
@WebServlet("/ProcesarFormularioServlet")
public class ProcesarFormularioServlet extends HttpServlet {
	private static final long serialVersionUID = 1L;
       
    /**
     * @see HttpServlet#HttpServlet()
     */
    public ProcesarFormularioServlet() {
        super();
        // TODO Auto-generated constructor stub
    }

	/**
	 * @see HttpServlet#doGet(HttpServletRequest request, HttpServletResponse response)
	 */
	protected void doGet(HttpServletRequest request, HttpServletResponse response) throws ServletException, IOException {
		// TODO Auto-generated method stub
		response.setContentType("text/html");
		PrintWriter out = response.getWriter();
		
	    int codigo = Integer.parseInt(request.getParameter("codigo"));
	    int categoria = Integer.parseInt(request.getParameter("categoria"));
	    String nombre = request.getParameter("nombre");
	    int cantidad = Integer.parseInt(request.getParameter("cantidad"));
	    double precio = Double.parseDouble(request.getParameter("precio"));
	    String imagen64 = "data:image/webp;base64,";
	    byte [] imagenByte = Base64.getDecoder().decode(imagen64.split(",")[1]);
	    
	    
	    Connection conn = Conexion.conectar();
	    if (conn == null) {
	    	System.out.println("Error");
	    	return;
	    }
	    
	    String insertProductoSQL = "INSERT INTO tb_producto (id_pr, id_cat, nombre_pr, cantidad_pr, precio_pr, foto_pr) VALUES (?, ?, ?, ?, ?, ?)";
	    try {
			PreparedStatement statement = conn.prepareStatement(insertProductoSQL);
			statement.setInt(1, codigo);
			statement.setInt(2, categoria);
			statement.setString(3, nombre);
			statement.setInt(4, cantidad);
			statement.setDouble(5, precio);
			statement.setBytes(6, imagenByte);
			
			int insercion = statement.executeUpdate();
			if (insercion > 0) {
				out.println("<h2>Exito</h2>");
			}
			else {
				out.println("<h2>Error</h2>");
			}
			
		} catch (SQLException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
			out.println("Error para guardar en la bdd" + e.getMessage());
		}
	    
	}

	/**
	 * @see HttpServlet#doPost(HttpServletRequest request, HttpServletResponse response)
	 */
	protected void doPost(HttpServletRequest request, HttpServletResponse response) throws ServletException, IOException {
		// TODO Auto-generated method stub
		//doGet(request, response);
	}

}
